import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AppComponent } from './app.component';
import { MilanoComponent } from './milano/milano.component';


const routes: Routes = [
  { path: '', component: AppComponent },          // Rotta per la home page
  { path: 'milano', component: MilanoComponent },     // Rotta per la pagina "about"
  { path: '**', redirectTo: '', pathMatch: 'full' } // Rotta di fallback per 404
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {}
